// #devices Component
import axios from 'axios';
import { appConstants } from '../../helpers/constants';


export const devices = {
    getDevices
};

function getDevices() {
    var data = sessionStorage.getItem('responseData')
    const result = axios({
        method: 'get',
        url: appConstants.API_URL_DEV + '/api/clients',
        headers: data.token
    })
        .then(response => {
            return (response.data.data);
        })
        .catch(error => {
            return error
        });

    return result
}
